
<!DOCTYPE html>
<html lang="ru">
<head>
    <meta charset="UTF-8">
    <title>PenaltyMind AI</title>
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <script src="https://telegram.org/js/telegram-web-app.js"></script>
    <style>
        body {
            font-family: 'Segoe UI', sans-serif;
            background-color: #101820;
            color: #ffffff;
            text-align: center;
            padding: 30px;
        }
        .container {
            max-width: 500px;
            margin: 0 auto;
            background-color: #1e2a38;
            padding: 20px;
            border-radius: 15px;
        }
        input {
            width: 80%;
            padding: 10px;
            margin: 15px 0;
            font-size: 16px;
            border-radius: 8px;
            border: none;
            background-color: #1c1c1c;
            color: white;
            text-align: center;
        }
        button {
            background-color: #3FC060;
            border: none;
            color: white;
            padding: 12px 20px;
            font-size: 16px;
            border-radius: 10px;
            cursor: pointer;
            margin-top: 10px;
            box-shadow: 0 0 12px #3FC060;
            transition: all 0.3s ease;
        }
        button:hover {
            transform: scale(1.05);
            box-shadow: 0 0 18px #52ff99;
        }
        .result {
            margin-top: 20px;
            font-size: 18px;
        }
        .goal-container {
            position: relative;
            display: inline-block;
            margin-top: 20px;
            width: 100%;
        }
        .goal-container img {
            width: 100%;
            border-radius: 12px;
        }
        .arrow {
            position: absolute;
            width: 50px;
            height: 50px;
            background-image: url('https://cdn-icons-png.flaticon.com/512/109/109617.png');
            background-size: cover;
            display: none;
        }
        a {
            color: #3FC060;
            text-decoration: none;
        }
    </style>
</head>

        <div class="result" id="result"></div>

    <script>
        const MAX_PREDICTIONS = 3;
        let predictions = 0;

        const positions = {
            left: { top: '40%', left: '10%', rotate: '-45deg' },
            center: { top: '10%', left: '45%', rotate: '0deg' },
            right: { top: '40%', left: '80%', rotate: '45deg' }
        };

        function startGame() {
            const userId = document.getElementById('userId').value.trim();
            if (!userId) {
                alert("Пожалуйста, введи свой ID.");
                return;
            }
            document.getElementById('goalContainer').style.display = 'block';
            makePrediction();
        }

        function makePrediction() {
            const resultDiv = document.getElementById('result');
            const arrow = document.getElementById('arrow');

            if (predictions >= MAX_PREDICTIONS) {
                resultDiv.innerHTML = 'Ты использовал 3 прогноза.<br><br><a href="https://t.me/your_channel" target="_blank">Перейти в Telegram для разблокировки</a>';
                arrow.style.display = 'none';
                return;
            }

            const directions = ["left", "center", "right"];
            const texts = {
                left: "В ЛЕВО (низ)",
                center: "В ЦЕНТР",
                right: "В ПРАВО (верх)"
            };
            const dir = directions[Math.floor(Math.random() * directions.length)];
            const pos = positions[dir];

            predictions++;
            arrow.style.top = pos.top;
            arrow.style.left = pos.left;
            arrow.style.transform = `rotate(${pos.rotate})`;
            arrow.style.display = 'block';

            resultDiv.innerHTML = `
                <p><strong>Следующий удар:</strong> ${texts[dir]}</p>
                <p>Уверенность алгоритма: <strong>${90 + Math.floor(Math.random() * 10)}%</strong></p>
                <p>Осталось прогнозов: ${MAX_PREDICTIONS - predictions}</p>
            `;
        }
    </script>
    <script>
        const tg = window.Telegram.WebApp;
        tg.expand();
    </script>
